                return ( 
                    <div>
                        <Navbar />
                        <SideBar />
                        <Login />
                    </div> )
            } else if (path === "/signup") {
                return ( 
                    <div>
                        <Navbar />
                        <SideBar />
                        <Signup />
                    </div> )
            } else if (path === "/reset-password") {
                return ( 
                    <div>
                        <Navbar />
                        <SideBar />
                        <Mail />
                    </div> )
            } else if (path === "/confirm-reset-password") {
                return ( 
                    <div>
                        <Navbar />
                        <SideBar />
                        <Password />
                    </div> )
            } else if (path === "/favorite") {
                return ( 
                    <div>
                        <Navbar />
                        <SideBar />
                    </div> )
            }else if (path === "/cos") {
                return ( 
                    <div>
